import Post from "./Post/Post";

const MyPosts = () => {
  return (
    <div>
      <div>
        <textarea name="" id="" cols="30" rows="10"></textarea>
        <button>Add post</button>
      </div>
      My Posts
      <Post message="Hellom whats up?" />
      <Post message="It's my birthday today"/>
